      else if (displaySunset === true) {
        dataTitle = "Sunset: ";
        data = this.props.sunset;
      }

      else if (displayMoonrise === true) {
        dataTitle = "Moonrise: ";
        data = this.props.moonrise;
      }

      else if (displayMoonset === true) {
        dataTitle = "Moonset: ";
        data = this.props.moonset;
      }

    return (
      <div className="riset__info">
        // Display sunrise and sunset

